class CmsModel {  int? id;  int? cmsId;  String? languageCode;  String? title;  String? pageTitle;  String? image;  String? description;  String? metaChar;  String? metaDesc;  String? createdAt;  String? updatedAt;  CmsModel(      {this.id,        this.cmsId,        this.languageCode,        this.title,        this.image,        this.pageTitle,        this.description,        this.metaChar,        this.metaDesc,        this.createdAt,        this.updatedAt});  CmsModel.fromJson(Map<String, dynamic> json) {    id = json['id'];    cmsId = json['cms_id'];    languageCode = json['language_code'];    title = json['title'];    pageTitle = json['page_title'];    image = json['image'];    description = json['description'];    metaChar = json['meta_char'];    metaDesc = json['meta_desc'];    createdAt = json['created_at'];    updatedAt = json['updated_at'];  }  Map<String, dynamic> toJson() {    final Map<String, dynamic> data = new Map<String, dynamic>();    data['id'] = this.id;    data['cms_id'] = this.cmsId;    data['language_code'] = this.languageCode;    data['title'] = this.title;    data['page_title'] = this.pageTitle;    data['image'] = this.image;    data['description'] = this.description;    data['meta_char'] = this.metaChar;    data['meta_desc'] = this.metaDesc;    data['created_at'] = this.createdAt;    data['updated_at'] = this.updatedAt;    return data;  }}